Insert into POI_VALOR_ETIQUETA (ID_POI,ID_ETIQUETA,VALOR,ID_AGRUPACION) values ('recurso-7425','2','Herramienta para la elaboración de&lt;br/&gt; contenidos de forma colectiva con el&lt;br/&gt; objetivo de analizar y mejorar los&lt;br/&gt; datos publicados sobre un barrio y &lt;br/&gt;realizar propuestas de mejora. Objetivo, enseñar a los niños a analizar la calidad&lt;br/&gt; de los datos, generar contenidos de forma&lt;br/&gt; colaborativa y facilitar la interacción &lt;br/&gt;con su Ayuntamiento.','14');
Insert into POI_VALOR_ETIQUETA (ID_POI,ID_ETIQUETA,VALOR,ID_AGRUPACION) values ('381','2','Actividades como las organizadas&lt;br/&gt; anualmente en la Carrera del Gancho&lt;br/&gt; sirven para dinamizar el barrio y&lt;br/&gt; promover la ciudadanía activa,&lt;br/&gt; además de contribuir a la &lt;br/&gt;integración de las personas de diferentes &lt;br/&gt;culturas. Por eso, pensamos que deberían&lt;br/&gt; aumentar este tipo de iniciativas,&lt;br/&gt; a nivel ciudad, con colaboración&lt;br/&gt; municipal en actividades deportivas,&lt;br/&gt; campañas de solidaridad, actividades&lt;br/&gt; conjuntas entre personas de la tercera edad&lt;br/&gt; y jóvenes etc...','14');
