Insert into POI_VALOR_ETIQUETA (ID_POI,ID_ETIQUETA,VALOR,ID_AGRUPACION) values ('recurso-3075','2','&lt;ul&gt;&lt;li&gt;Hay una cosa que nos molesta mucho&lt;br/&gt; cuando estamos en el colegio y es que todos los días&lt;br/&gt; pasan varios aviones y nos obligan a&lt;br/&gt; parar las clases por el ruido que hacen&lt;br/&gt; pues no oímos al profesor &lt;br/&gt;o a los compañeros que están hablando. ¿No podrían &lt;br/&gt;pasar los aviones más lejos o más alto o a otras horas para que &lt;br/&gt;no hicieran tanto ruido?.&lt;/li&gt;&lt;li&gt;Poner en el recreo más sombra porque&lt;br/&gt; hay muy pocos árboles y cuando hace mucho&lt;br/&gt; sol tenemos mucho calor.&lt;br/&gt; También estaría bien contar con un porche&lt;br/&gt; para cuando hace mucho calor o &lt;br/&gt;cuando llueve.&lt;/li&gt;&lt;/ul&gt;','14');
